.arrow-left.icon {
  color: #fff;
  position: absolute;
  top: 30px;
  margin-left: 3px;
  margin-top: 10px;
  width: 32px;
  height: 0px;
  background-color: currentColor;
}

.arrow-left.icon:before {
  content: '';
  position: absolute;
  left: 10px;
  top: -10px;
  width: 20px;
  height: 20px;
  border-top: solid 2px currentColor;
  border-right: solid 2px currentColor;
  -webkit-transform: rotate(-135deg);
  -webkit-transform-transform: rotate(-135deg);
}

.arrow-right.icon {
  color: #fff;
  position: absolute;
  top: 30px;
  margin-left: 2px;
  margin-top: 10px;
  width: 32px;
  height: 0px;
  background-color: currentColor;
}

.arrow-right.icon:before {
  content: '';
  position: absolute;
  right: 10px;
  top: -10px;
